// frontend/src/components/Navbar.js
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <h1>Travel App</h1>
      <ul>
        <li><Link to="/">Inicio</Link></li>
        <li><Link to="/add-trip">Agregar Viaje</Link></li>
        <li><Link to="/see-trips">Consultar Viajes</Link></li>
        <li><Link to="/add-comment">Agregar Comentario</Link></li>
      </ul>
    </nav>
  );
};

export default Navbar;
